contracts/CarMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./CarNFT.sol";
import "./CarPart.sol";

contract CarMarketplace is Ownable, ReentrancyGuard {
    CarNFT public carNFT;
    CarPart public carPart;

    // Structure to handle part slots that are sold with the car
    struct PartSlot {
        bool included;    // true if the slot is included in the sale
        uint256 partId;  // ID of the part in that slot (0 if empty)
    }

    // Structure for a car listing
    struct CarListing {
        address seller;
        uint256 carId;
        uint256 price;
        PartSlot[3] partSlots;  // Fixed array of 3 slots (engine, transmission, wheels)
        bool active;
    }

    // Structure for an individual part listing
    struct PartListing {
        address seller;
        uint256 partId;
        uint256 price;
        bool active;
    }

    // Mappings to store listings
    mapping(uint256 => CarListing) public carListings;     // carId => CarListing
    mapping(uint256 => PartListing) public partListings;   // partId => PartListing

    // Marketplace fee (in percentage, e.g., 250 = 2.5%)
    uint256 public marketplaceFee = 250;  // 2.5% default

    event CarListed(uint256 indexed carId, address indexed seller, uint256 price, bool[3] slotsIncluded);
    event PartListed(uint256 indexed partId, address indexed seller, uint256 price);
    event CarSold(uint256 indexed carId, address indexed seller, address indexed buyer, uint256 price);
    event PartSold(uint256 indexed partId, address indexed seller, address indexed buyer, uint256 price);
    event ListingCancelled(uint256 indexed itemId, bool isCar);
    event MarketplaceFeeUpdated(uint256 newFee);

    constructor(address _carNFT, address _carPart) {
        carNFT = CarNFT(_carNFT);
        carPart = CarPart(_carPart);
        _transferOwnership(msg.sender);
    }

    // Function to list a car with selected parts
    function listCar(
        uint256 carId,
        uint256 price,
        bool[3] memory includeSlots
    ) external {
        require(carNFT.ownerOf(carId) == msg.sender, "Not the car owner");
        require(price > 0, "Price must be greater than 0");
        require(carNFT.isApprovedForAll(msg.sender, address(this)) || 
                carNFT.getApproved(carId) == address(this), 
                "Marketplace not authorized for car");

        // Get current car composition
        (uint256[] memory partIds, , bool[] memory slotOccupied) = carNFT.getCarComposition(carId);

        PartSlot[3] memory slots;
        for (uint256 i = 0; i < 3; i++) {
            if (includeSlots[i]) {
                require(slotOccupied[i], "Cannot include empty slot");
                require(carPart.ownerOf(partIds[i]) == msg.sender, "Not owner of all parts");
                require(carPart.isApprovedForAll(msg.sender, address(this)) || 
                        carPart.getApproved(partIds[i]) == address(this), 
                        "Marketplace not authorized for parts");
                slots[i] = PartSlot({
                    included: true,
                    partId: partIds[i]
                });
            }
        }

        carListings[carId] = CarListing({
            seller: msg.sender,
            carId: carId,
            price: price,
            partSlots: slots,
            active: true
        });

        emit CarListed(carId, msg.sender, price, includeSlots);
    }

    // Function to list an individual part
    function listPart(uint256 partId, uint256 price) external {
        require(carPart.ownerOf(partId) == msg.sender, "Not the part owner");
        require(price > 0, "Price must be greater than 0");
        require(!carPart.isEquipped(partId), "Part is equipped in a car");

        partListings[partId] = PartListing({
            seller: msg.sender,
            partId: partId,
            price: price,
            active: true
        });

        emit PartListed(partId, msg.sender, price);
    }

    // Function to buy a listed car
    function buyCar(uint256 carId) external payable nonReentrant {
        CarListing storage listing = carListings[carId];
        require(listing.active, "Listing not active");
        require(msg.value >= listing.price, "Insufficient payment");

        address seller = listing.seller;
        require(seller != msg.sender, "Cannot buy your own listing");

        // Verify seller still owns car and parts
        require(carNFT.ownerOf(carId) == seller, "Seller no longer owns the car");

        for (uint256 i = 0; i < 3; i++) {
            if (listing.partSlots[i].included) {
                require(carPart.ownerOf(listing.partSlots[i].partId) == seller, 
                    "Seller no longer owns all parts");
            }
        }

        // Calculate fee and payment to seller
        uint256 fee = (listing.price * marketplaceFee) / 10000;
        uint256 payment = listing.price - fee;

        // Transfer NFTs
        carNFT.transferFrom(seller, msg.sender, carId);
        for (uint256 i = 0; i < 3; i++) {
            if (listing.partSlots[i].included) {
                carPart.transferFrom(seller, msg.sender, listing.partSlots[i].partId);
            }
        }

        // Transfer payments
        (bool success, ) = payable(seller).call{value: payment}("");
        require(success, "Error sending payment to seller");

        // Deactivate listing
        listing.active = false;

        emit CarSold(carId, seller, msg.sender, listing.price);
    }

    // Function to buy a listed part
    function buyPart(uint256 partId) external payable nonReentrant {
        PartListing storage listing = partListings[partId];
        require(listing.active, "Listing not active");
        require(msg.value >= listing.price, "Insufficient payment");

        address seller = listing.seller;
        require(seller != msg.sender, "Cannot buy your own listing");
        require(carPart.ownerOf(partId) == seller, "Seller no longer owns the part");

        // Calculate fee and payment to seller
        uint256 fee = (listing.price * marketplaceFee) / 10000;
        uint256 payment = listing.price - fee;

        // Transfer NFT
        carPart.transferFrom(seller, msg.sender, partId);

        // Transfer payment
        (bool success, ) = payable(seller).call{value: payment}("");
        require(success, "Error sending payment to seller");

        // Deactivate listing
        listing.active = false;

        emit PartSold(partId, seller, msg.sender, listing.price);
    }

    // Function to cancel a car listing
    function cancelCarListing(uint256 carId) external {
        CarListing storage listing = carListings[carId];
        require(listing.active, "Listing not active");
        require(listing.seller == msg.sender, "Not the seller");

        listing.active = false;
        emit ListingCancelled(carId, true);
    }

    // Function to cancel a part listing
    function cancelPartListing(uint256 partId) external {
        PartListing storage listing = partListings[partId];
        require(listing.active, "Listing not active");
        require(listing.seller == msg.sender, "Not the seller");

        listing.active = false;
        emit ListingCancelled(partId, false);
    }

    // Function to update marketplace fee (owner only)
    function setMarketplaceFee(uint256 newFee) external onlyOwner {
        require(newFee <= 1000, "Maximum fee is 10%");
        marketplaceFee = newFee;
        emit MarketplaceFeeUpdated(newFee);
    }

    // Function to withdraw accumulated fees (owner only)
    function withdrawFees() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No funds to withdraw");

        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Error withdrawing funds");
    }

    // Helper function to check approvals
    function checkCarApproval(address owner, uint256 carId) public view returns (bool) {
        return carNFT.isApprovedForAll(owner, address(this)) || 
               carNFT.getApproved(carId) == address(this);
    }

    function checkPartApproval(address owner, uint256 partId) public view returns (bool) {
        return carPart.isApprovedForAll(owner, address(this)) || 
               carPart.getApproved(partId) == address(this);
    }

    // Function to get approval status for a car and its parts
    function getListingApprovalStatus(uint256 carId, bool[3] memory includeSlots) external view returns (
        bool carApproved,
        bool[] memory partsApproved
    ) {
        address owner = carNFT.ownerOf(carId);
        carApproved = checkCarApproval(owner, carId);

        (uint256[] memory partIds, , bool[] memory slotOccupied) = carNFT.getCarComposition(carId);
        partsApproved = new bool[](3);

        for (uint256 i = 0; i < 3; i++) {
            if (includeSlots[i] && slotOccupied[i]) {
                partsApproved[i] = checkPartApproval(owner, partIds[i]);
            }
        }

        return (carApproved, partsApproved);
    }
}

contracts/CarNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./CarPart.sol";

contract CarNFT is ERC721, Ownable {
    struct CarComposition {
        uint256[] partIds;
        string carImageURI;
        bool[] slotOccupied;
    }

    mapping(uint256 => CarComposition) private _cars;
    CarPart public carPartContract;
    uint256 private _currentCarId;
    mapping(uint256 => uint8) private _carConditions;
    address public workshopContract;
    address public leaderboardContract;

    event CarMinted(uint256 indexed carId, address indexed owner);
    event PartReplaced(uint256 indexed carId, uint256 oldPartId, uint256 newPartId);
    event WorkshopSet(address indexed workshop);
    event LeaderboardSet(address indexed leaderboard);
    event MintPriceChanged(uint256 newPrice);
    event PartUnequipped(uint256 indexed carId, uint256 indexed partId);
    event PartEquipped(uint256 indexed carId, uint256 indexed partId, uint256 slotIndex);

    uint256 public mintPrice;

    constructor(address _carPartContractAddress) ERC721("CarNFT", "CAR") {
        carPartContract = CarPart(_carPartContractAddress);
        _currentCarId = 1;
        mintPrice = 0.01 ether; // Initial minting price
        _transferOwnership(msg.sender);
    }

    function setMintPrice(uint256 _newPrice) external onlyOwner {
        mintPrice = _newPrice;
        emit MintPriceChanged(_newPrice);
    }

    function withdrawFunds() external onlyOwner {
        uint256 balance = address(this).balance;
        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Error withdrawing funds");
    }

    struct PartData {
        CarPart.PartType partType;
        uint8 stat1;
        uint8 stat2;
        uint8 stat3;
        string imageURI;
    }

    function mintCar(string memory carImageURI, PartData[] memory partsData) external payable {
        require(msg.value >= mintPrice, "Insufficient payment");
        require(partsData.length <= 3, "Too many parts");

        uint256 carId = _currentCarId;
        _mint(msg.sender, carId);

        uint256[] memory partIds = new uint256[](3);
        bool[] memory slotOccupied = new bool[](3);

        bool hasEngine = false;
        bool hasTransmission = false;
        bool hasWheels = false;

        for (uint256 i = 0; i < partsData.length; i++) {
            if (partsData[i].partType == CarPart.PartType.ENGINE) hasEngine = true;
            else if (partsData[i].partType == CarPart.PartType.TRANSMISSION) hasTransmission = true;
            else if (partsData[i].partType == CarPart.PartType.WHEELS) hasWheels = true;

            uint256 partId = carPartContract.mint(
                msg.sender,
                partsData[i].partType,
                partsData[i].stat1,
                partsData[i].stat2,
                partsData[i].stat3,
                partsData[i].imageURI,
                carId
            );

            // Asignar la parte al slot correcto segn su tipo
            uint256 slotIndex;
            if (partsData[i].partType == CarPart.PartType.ENGINE) slotIndex = 0;
            else if (partsData[i].partType == CarPart.PartType.TRANSMISSION) slotIndex = 1;
            else slotIndex = 2;

            partIds[slotIndex] = partId;
            slotOccupied[slotIndex] = true;
        }

        require(hasEngine && hasTransmission && hasWheels, "Car must have an engine, transmission, and wheels");

        _cars[carId] = CarComposition({
            partIds: partIds,
            carImageURI: carImageURI,
            slotOccupied: slotOccupied
        });

        _carConditions[carId] = 100; // New car, perfect condition
        emit CarMinted(carId, msg.sender);
        _currentCarId++;
    }

    function unequipPart(uint256 carId, uint256 partId) external {
        require(_ownerOf(carId) != address(0), "Car does not exist");
        require(ownerOf(carId) == msg.sender, "Not the car owner");
        require(carPartContract.ownerOf(partId) == msg.sender, "Not the owner of the part");

        CarComposition storage car = _cars[carId];
        bool found = false;
        uint256 partIndex;

        for (uint256 i = 0; i < car.partIds.length; i++) {
            if (car.partIds[i] == partId && car.slotOccupied[i]) {
                partIndex = i;
                found = true;
                break;
            }
        }

        require(found, "Part not found in this car");
        require(carPartContract.getEquippedCar(partId) == carId, "Part is not equipped in this car");

        // Marcar el slot como vaco y actualizar el estado de la parte
        car.slotOccupied[partIndex] = false;
        carPartContract.setEquippedState(partId, 0);

        emit PartUnequipped(carId, partId);
    }

    function equipPart(uint256 carId, uint256 partId, uint256 slotIndex) external {
        require(_ownerOf(carId) != address(0), "Car does not exist");
        require(ownerOf(carId) == msg.sender, "Not the car owner");
        require(carPartContract.ownerOf(partId) == msg.sender, "Not the owner of the part");
        require(slotIndex < 3, "Invalid slot index");
        require(!carPartContract.isEquipped(partId), "Part is already equipped in another car");

        CarComposition storage car = _cars[carId];
        require(!car.slotOccupied[slotIndex], "Slot is already occupied");

        // Verificar que la parte sea del tipo correcto para el slot
        CarPart.PartType partType = carPartContract.getPartType(partId);
        require(
            (slotIndex == 0 && partType == CarPart.PartType.ENGINE) ||
            (slotIndex == 1 && partType == CarPart.PartType.TRANSMISSION) ||
            (slotIndex == 2 && partType == CarPart.PartType.WHEELS),
            "Part type does not match slot"
        );

        car.partIds[slotIndex] = partId;
        car.slotOccupied[slotIndex] = true;
        carPartContract.setEquippedState(partId, carId);

        emit PartEquipped(carId, partId, slotIndex);
    }

    function getCarComposition(uint256 carId) external view returns (uint256[] memory partIds, string memory carImageURI, bool[] memory slotOccupied) {
        require(_ownerOf(carId) != address(0), "Car does not exist");
        CarComposition storage car = _cars[carId];
        return (car.partIds, car.carImageURI, car.slotOccupied);
    }

    function replacePart(uint256 carId, uint256 oldPartId, uint256 newPartId) external {
        require(_ownerOf(carId) != address(0), "Car does not exist");
        require(ownerOf(carId) == msg.sender, "Not the car owner");
        require(carPartContract.ownerOf(newPartId) == msg.sender, "Not the owner of the new part");
        require(!carPartContract.isEquipped(newPartId), "New part is already equipped in another car");

        CarComposition storage car = _cars[carId];
        bool found = false;
        uint256 oldPartIndex;

        for (uint256 i = 0; i < car.partIds.length; i++) {
            if (car.partIds[i] == oldPartId && car.slotOccupied[i]) {
                oldPartIndex = i;
                found = true;
                break;
            }
        }

        require(found, "Original part not found in this car");
        require(carPartContract.getEquippedCar(oldPartId) == carId, "Old part is not equipped in this car");

        // Verify that the new part is of the same type as the old one
        CarPart.PartType oldType = carPartContract.getPartType(oldPartId);
        CarPart.PartType newType = carPartContract.getPartType(newPartId);
        require(oldType == newType, "New part must be of the same type as the original");

        // Actualizar el estado de equipamiento de ambas partes
        carPartContract.setEquippedState(oldPartId, 0);
        carPartContract.setEquippedState(newPartId, carId);
        car.partIds[oldPartIndex] = newPartId;

        emit PartReplaced(carId, oldPartId, newPartId);
    }

    struct CompactCarStats {
        string imageURI;
        uint8 speed;
        uint8 acceleration;
        uint8 handling;
        uint8 driftFactor;
        uint8 turnFactor;
        uint8 maxSpeed;
        uint8 condition;
    }

    struct FullCarMetadata {
        // Basic car data
        uint256 carId;
        address owner;
        string carImageURI;
        uint8 condition;

        // Processed car stats
        CarStats combinedStats;

        // Detailed part information
        PartFullMetadata[] parts;
    }

    struct CarStats {
        uint8 speed;
        uint8 acceleration;
        uint8 handling;
        uint8 driftFactor;
        uint8 turnFactor;
        uint8 maxSpeed;
    }

    struct PartFullMetadata {
        uint256 partId;
        CarPart.PartType partType;
        string imageURI;
        PartTypeStats stats;
    }

    struct PartTypeStats {
        // Engine
        uint8 speed;
        uint8 maxSpeed;
        uint8 acceleration;
        // Transmission
        uint8 transmissionAcceleration;
        uint8 transmissionSpeed;
        uint8 transmissionHandling;
        // Wheels
        uint8 handling;
        uint8 driftFactor;
        uint8 turnFactor;
    }

    function getLastTokenId() public view returns (uint256) {
        return _currentCarId - 1;
    }

    function getFullCarMetadata(uint256 carId) external view returns (FullCarMetadata memory) {
        require(_ownerOf(carId) != address(0), "Car does not exist");

        // Get basic car composition
        CarComposition storage car = _cars[carId];

        // Get processed stats
        CompactCarStats memory compactStats = this.getCompactCarStats(carId);

        // Prepare parts array
        PartFullMetadata[] memory parts = new PartFullMetadata[](car.partIds.length);

        // Get detailed information for each part
        for (uint256 i = 0; i < car.partIds.length; i++) {
            uint256 partId = car.partIds[i];
            CarPart.PartStats memory partStats = carPartContract.getPartStats(partId);

            // Initialize type-specific stats
            PartTypeStats memory typeStats;

            if (partStats.partType == CarPart.PartType.ENGINE) {
                typeStats.speed = partStats.stat1;
                typeStats.maxSpeed = partStats.stat2;
                typeStats.acceleration = partStats.stat3;
            } else if (partStats.partType == CarPart.PartType.TRANSMISSION) {
                typeStats.transmissionAcceleration = partStats.stat1;
                typeStats.transmissionSpeed = partStats.stat2;
                typeStats.transmissionHandling = partStats.stat3;
            } else { // WHEELS
                typeStats.handling = partStats.stat1;
                typeStats.driftFactor = partStats.stat2;
                typeStats.turnFactor = partStats.stat3;
            }

            parts[i] = PartFullMetadata({
                partId: partId,
                partType: partStats.partType,
                imageURI: partStats.imageURI,
                stats: typeStats
            });
        }

        // Create combined stats structure
        CarStats memory combinedStats = CarStats({
            speed: compactStats.speed,
            acceleration: compactStats.acceleration,
            handling: compactStats.handling,
            driftFactor: compactStats.driftFactor,
            turnFactor: compactStats.turnFactor,
            maxSpeed: compactStats.maxSpeed
        });

        return FullCarMetadata({
            carId: carId,
            owner: ownerOf(carId),
            carImageURI: car.carImageURI,
            condition: compactStats.condition,
            combinedStats: combinedStats,
            parts: parts
        });
    }

    function getCompactCarStats(uint256 carId) external view returns (CompactCarStats memory) {
        require(_ownerOf(carId) != address(0), "Car does not exist");
        CarComposition storage car = _cars[carId];

        uint256 totalSpeed;
        uint256 totalAcceleration;
        uint256 totalHandling;
        uint256 totalDriftFactor;
        uint256 totalTurnFactor;
        uint256 totalMaxSpeed;

        uint256 speedContributors = 0;
        uint256 accelerationContributors = 0;
        uint256 handlingContributors = 0;
        uint256 driftContributors = 0;
        uint256 turnContributors = 0;
        uint256 maxSpeedContributors = 0;

        for (uint256 i = 0; i < car.partIds.length; i++) {
            (
                uint8 baseSpeed,
                uint8 baseAcceleration,
                uint8 baseHandling,
                uint8 baseDriftFactor,
                uint8 baseTurnFactor,
                uint8 baseMaxSpeed
            ) = carPartContract.convertToLegacyStats(car.partIds[i]);

            if (baseSpeed > 1) {
                totalSpeed += baseSpeed;
                speedContributors++;
            }
            if (baseAcceleration > 1) {
                totalAcceleration += baseAcceleration;
                accelerationContributors++;
            }
            if (baseHandling > 1) {
                totalHandling += baseHandling;
                handlingContributors++;
            }
            if (baseDriftFactor > 1) {
                totalDriftFactor += baseDriftFactor;
                driftContributors++;
            }
            if (baseTurnFactor > 1) {
                totalTurnFactor += baseTurnFactor;
                turnContributors++;
            }
            if (baseMaxSpeed > 1) {
                totalMaxSpeed += baseMaxSpeed;
                maxSpeedContributors++;
            }
        }

        uint8 condition = _carConditions[carId];
        if (condition == 0) condition = 100;

        uint256 multiplier = condition;

        // Adjust divisor based on number of contributors for each stat
        return CompactCarStats({
            imageURI: car.carImageURI,
            speed: uint8(speedContributors > 0 ? (totalSpeed * multiplier) / (speedContributors * 100) : 1),
            acceleration: uint8(accelerationContributors > 0 ? (totalAcceleration * multiplier) / (accelerationContributors * 100) : 1),
            handling: uint8(handlingContributors > 0 ? (totalHandling * multiplier) / (handlingContributors * 100) : 1),
            driftFactor: uint8(driftContributors > 0 ? (totalDriftFactor * multiplier) / (driftContributors * 100) : 1),
            turnFactor: uint8(turnContributors > 0 ? (totalTurnFactor * multiplier) / (turnContributors * 100) : 1),
            maxSpeed: uint8(maxSpeedContributors > 0 ? (totalMaxSpeed * multiplier) / (maxSpeedContributors * 100) : 1),
            condition: condition
        });
    }

    function setWorkshopContract(address _workshop) external onlyOwner {
        workshopContract = _workshop;
        emit WorkshopSet(_workshop);
    }

    function setLeaderboardContract(address _leaderboard) external onlyOwner {
        leaderboardContract = _leaderboard;
        emit LeaderboardSet(_leaderboard);
    }

    function degradeCar(uint256 carId) external {
        require(msg.sender == leaderboardContract, "Only leaderboard contract can degrade cars");
        require(_ownerOf(carId) != address(0), "Car does not exist");

        if (_carConditions[carId] == 0) {
            _carConditions[carId] = 100;
        }

        if (_carConditions[carId] >= 5) {
            _carConditions[carId] -= 5;
        } else {
            _carConditions[carId] = 0;
        }
    }

    function repairCar(uint256 carId) external {
        require(msg.sender == workshopContract, "Only workshop can repair cars");
        require(_ownerOf(carId) != address(0), "Car does not exist");
        _carConditions[carId] = 100;
    }

    function exists(uint256 carId) public view returns (bool) {
        return _ownerOf(carId) != address(0);
    }
}

contracts/CarPart.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract CarPart is ERC721, Ownable {
    enum PartType { ENGINE, TRANSMISSION, WHEELS }

    struct PartStats {
        PartType partType;
        uint8 stat1;
        uint8 stat2;
        uint8 stat3;
        string imageURI;
    }

    // Core storage
    mapping(uint256 => PartStats) private _partStats;
    mapping(uint256 => uint256) private _equippedInCar; // partId => carId (0 if not equipped)
    uint256 private _currentPartId;
    address public carContract;

    // New mappings for better part tracking
    mapping(address => uint256[]) private _ownerParts;                // owner => all their partIds
    mapping(address => mapping(PartType => uint256[])) private _ownerPartsByType;  // owner => type => partIds
    mapping(address => uint256[]) private _ownerEquippedParts;        // owner => their equipped partIds
    mapping(address => uint256[]) private _ownerUnequippedParts;      // owner => their unequipped partIds

    event PartMinted(uint256 indexed partId, PartType partType);
    event CarContractSet(address indexed carContract);
    event PartEquipped(uint256 indexed partId, uint256 indexed carId);
    event PartUnequipped(uint256 indexed partId, uint256 indexed carId);

    constructor() ERC721("CarPart", "PART") {
        _currentPartId = 0;
        _transferOwnership(msg.sender);
    }

    modifier onlyCarContract() {
        require(msg.sender == carContract, "Only car contract can call this function");
        _;
    }

    function setCarContract(address _carContract) external onlyOwner {
        carContract = _carContract;
        emit CarContractSet(_carContract);
    }

    function mint(
        address to,
        PartType partType,
        uint8 stat1,
        uint8 stat2,
        uint8 stat3,
        string memory imageURI,
        uint256 carId
    ) external onlyCarContract returns (uint256) {
        require(stat1 <= 10 && stat2 <= 10 && stat3 <= 10, "Stats must be <= 10");

        uint256 partId = _currentPartId;
        _safeMint(to, partId);

        _partStats[partId] = PartStats({
            partType: partType,
            stat1: stat1,
            stat2: stat2,
            stat3: stat3,
            imageURI: imageURI
        });

        // When minted, the part is automatically equipped in the car
        _equippedInCar[partId] = carId;
        _addToOwnerArrays(to, partId);

        emit PartMinted(partId, partType);
        emit PartEquipped(partId, carId);
        _currentPartId++;

        return partId;
    }

    // Override _transfer to update owner mappings
    function _transfer(address from, address to, uint256 tokenId) internal virtual override {
        super._transfer(from, to, tokenId);

        // Remove from old owner's arrays
        if (from != address(0)) {
            _removeFromOwnerArrays(from, tokenId);
        }

        // Add to new owner's arrays
        _addToOwnerArrays(to, tokenId);
    }

    function _addToOwnerArrays(address owner, uint256 partId) internal {
        PartStats memory stats = _partStats[partId];

        // Add to general parts array
        _ownerParts[owner].push(partId);

        // Add to type-specific array
        _ownerPartsByType[owner][stats.partType].push(partId);

        // Add to equipped/unequipped array
        if (_equippedInCar[partId] == 0) {
            _ownerUnequippedParts[owner].push(partId);
        } else {
            _ownerEquippedParts[owner].push(partId);
        }
    }

    function _removeFromOwnerArrays(address owner, uint256 partId) internal {
        // Remove from general parts array
        _removeFromArray(_ownerParts[owner], partId);

        // Remove from type-specific array
        PartStats memory stats = _partStats[partId];
        _removeFromArray(_ownerPartsByType[owner][stats.partType], partId);

        // Remove from equipped/unequipped array
        if (_equippedInCar[partId] == 0) {
            _removeFromArray(_ownerUnequippedParts[owner], partId);
        } else {
            _removeFromArray(_ownerEquippedParts[owner], partId);
        }
    }

    function _removeFromArray(uint256[] storage array, uint256 value) internal {
        for (uint i = 0; i < array.length; i++) {
            if (array[i] == value) {
                array[i] = array[array.length - 1];
                array.pop();
                break;
            }
        }
    }

    function setEquippedState(uint256 partId, uint256 carId) external onlyCarContract {
        require(_ownerOf(partId) != address(0), "Part does not exist");
        address owner = ownerOf(partId);

        // If part was unequipped and is now being equipped
        if (_equippedInCar[partId] == 0 && carId != 0) {
            _removeFromArray(_ownerUnequippedParts[owner], partId);
            _ownerEquippedParts[owner].push(partId);
            emit PartEquipped(partId, carId);
        }
        // If part was equipped and is now being unequipped
        else if (_equippedInCar[partId] != 0 && carId == 0) {
            _removeFromArray(_ownerEquippedParts[owner], partId);
            _ownerUnequippedParts[owner].push(partId);
            emit PartUnequipped(partId, _equippedInCar[partId]);
        }

        _equippedInCar[partId] = carId;
    }

    // Query functions for frontend
    function getOwnerParts(address owner) external view returns (uint256[] memory) {
        return _ownerParts[owner];
    }

    function getOwnerPartsByType(address owner, PartType partType) external view returns (uint256[] memory) {
        return _ownerPartsByType[owner][partType];
    }

    function getOwnerEquippedParts(address owner) external view returns (uint256[] memory) {
        return _ownerEquippedParts[owner];
    }

    function getOwnerUnequippedParts(address owner) external view returns (uint256[] memory) {
        return _ownerUnequippedParts[owner];
    }

    function getOwnerPartsWithDetails(address owner) external view returns (
        PartStats[] memory allParts,
        PartStats[] memory equippedParts,
        PartStats[] memory unequippedParts,
        uint256[] memory equippedInCarIds
    ) {
        uint256[] memory allPartIds = _ownerParts[owner];
        uint256[] memory equippedPartIds = _ownerEquippedParts[owner];
        uint256[] memory unequippedPartIds = _ownerUnequippedParts[owner];

        allParts = new PartStats[](allPartIds.length);
        equippedParts = new PartStats[](equippedPartIds.length);
        unequippedParts = new PartStats[](unequippedPartIds.length);
        equippedInCarIds = new uint256[](equippedPartIds.length);

        // Fill all parts
        for (uint i = 0; i < allPartIds.length; i++) {
            allParts[i] = _partStats[allPartIds[i]];
        }

        // Fill equipped parts
        for (uint i = 0; i < equippedPartIds.length; i++) {
            equippedParts[i] = _partStats[equippedPartIds[i]];
            equippedInCarIds[i] = _equippedInCar[equippedPartIds[i]];
        }

        // Fill unequipped parts
        for (uint i = 0; i < unequippedPartIds.length; i++) {
            unequippedParts[i] = _partStats[unequippedPartIds[i]];
        }

        return (allParts, equippedParts, unequippedParts, equippedInCarIds);
    }

    // Existing utility functions
    function getPartStats(uint256 partId) external view returns (PartStats memory) {
        require(_ownerOf(partId) != address(0), "Part does not exist");
        return _partStats[partId];
    }

    function getPartType(uint256 partId) external view returns (PartType) {
        require(_ownerOf(partId) != address(0), "Part does not exist");
        return _partStats[partId].partType;
    }

    function isEquipped(uint256 partId) external view returns (bool) {
        require(_ownerOf(partId) != address(0), "Part does not exist");
        return _equippedInCar[partId] != 0;
    }

    function getEquippedCar(uint256 partId) external view returns (uint256) {
        require(_ownerOf(partId) != address(0), "Part does not exist");
        return _equippedInCar[partId];
    }

    function exists(uint256 partId) external view returns (bool) {
        return _ownerOf(partId) != address(0);
    }

    // Helper function to convert stats to legacy format for compatibility
    function convertToLegacyStats(uint256 partId) external view returns (
        uint8 baseSpeed,
        uint8 baseAcceleration,
        uint8 baseHandling,
        uint8 baseDriftFactor,
        uint8 baseTurnFactor,
        uint8 baseMaxSpeed
    ) {
        require(_ownerOf(partId) != address(0), "Part does not exist");
        PartStats memory stats = _partStats[partId];

        if (stats.partType == PartType.ENGINE) {
            // Engine: speed, max speed, acceleration
            baseSpeed = stats.stat1;
            baseMaxSpeed = stats.stat2;
            baseAcceleration = stats.stat3;
            // Default values for other stats
            baseHandling = 1;
            baseDriftFactor = 1;
            baseTurnFactor = 1;
        } 
        else if (stats.partType == PartType.TRANSMISSION) {
            // Transmission: acceleration, speed, handling
            baseAcceleration = stats.stat1;
            baseSpeed = stats.stat2;
            baseHandling = stats.stat3;
            // Default values for other stats
            baseDriftFactor = 1;
            baseTurnFactor = 1;
            baseMaxSpeed = stats.stat1; // Acceleration affects max speed
        }
        else if (stats.partType == PartType.WHEELS) {
            // Wheels: handling, drift, turn
            baseHandling = stats.stat1;
            baseDriftFactor = stats.stat2;
            baseTurnFactor = stats.stat3;
            // Default values for other stats
            baseSpeed = 1;
            baseAcceleration = 1;
            baseMaxSpeed = 1;
        }
    }
}

